AND([Case].RecordType.Name = 'Casos Corredora', ISPICKVAL([Case].Type,'Reclamo'), NOT(ISPICKVAL([Case].Status,'Cerrado')), OR(ISPICKVAL([Case].Subtipo__c ,'Comisiones y facturas'),ISPICKVAL([Case].Subtipo__c ,'Declaraciones Retenidas SII')) )
)

